			[string]$Description,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateNotNullOrEmpty()]
			[string]$SvcAccountUN,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateNotNullOrEmpty()]
			[string]$SvcAccountPW,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateSet('Boot', 'System', 'Auto', 'Demand', 'Disabled', 'Delayed-Auto')]
			$StartupType,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateScript({ ([System.IO.File]::Exists($($_))) })]
			[string]$PS1,
			
			[PARAMETER(Mandatory = $true)]
			[ValidateScript({ ($($_.ToString()) -like "*.exe") })]
			[string]$EXE,
			
			[switch]$StartNow,
			
			[string]$PaaSdir = "$($env:ProgramFiles)\PaaS",
			
			[string]$CoreDLLPath = "$PaaSdir\Sorlov.PowerShell.Core.dll",
			
			[string]$SelfHostedDLLPath = "$PaaSdir\Sorlov.PowerShell.SelfHosted.dll",
			
			[string]$PSD1ModulePath = "$PaaSdir\psd1.psd1",
			
			[string]$ServiceName,
			
			[string]$DLL_SelfHosted = '',
			
			[string]$DLL_Core = '',
			
			[string]$PSD1_psd1 = ''
		)
		
		BEGIN
		{
			Log-Status -Status "Exporting required files...please be patient" -Icon Success
			IF ((Test-Path $PaaSdir) -eq $false)
			{
				New-Item $PaaSdir -ItemType Directory -Force | Out-Null
			}
			
			FUNCTION Convert_Export-File
			{
				PARAM (
					[Parameter(Mandatory = $true, Position = 0)]
					[ValidateNotNullOrEmpty()]
					[string]$File,
					
					[Parameter(Mandatory = $true, Position = 1)]
					[ValidateNotNullOrEmpty()]
					[string]$ExportTo
				)
				
				TRY
				{
					IF (-not (Test-Path -Path $ExportTo)){ 
						$bytes = [System.Convert]::FromBase64String($File)
						$null = [System.IO.File]::WriteAllBytes($ExportTo, $bytes)
						Start-Sleep -Milliseconds 100
						
						IF (Test-Path $ExportTo)
						{
							return $true
						}
						ELSE
						{
							return $false
						}
	                }
					IF (Test-Path -Path $ExportTo){
						return $true
					}
				}
				
				CATCH
				{
					Write-Error "The following error was encountered: $($_) :EndError"
				}
				
			}
			
		}
		
		PROCESS
		{
			TRY
			{
				IF (($PSBoundParameters["StartupType"] -eq "Disabled") -and ($PSBoundParameters["StartNow"]))
				{
					Log-Status -Status "'StartupType'='Disabled' | 'StartNow'='True' |" -Icon Warning
					Log-Status -Status "The above configuration is not allowed, changing 'StartNow'='False'" -Icon Error
					Log-Status -Status "Your service will NOT be started immediately after installation!" -Icon Error
					$StartNow = $false
					$DoNotStartService = $true
				}
				
				$DllShResult = Convert_Export-File -File $DLL_SelfHosted -ExportTo $SelfHostedDLLPath
				$DllCoreResult = Convert_Export-File -File $DLL_Core -ExportTo $CoreDLLPath
				$Psd1Result = Convert_Export-File -File $PSD1_psd1 -ExportTo $PSD1ModulePath
				$isPathError = $null
				$isModuleError = $null
				
				
				IF (($DllShResult) -and ($DllCoreResult) -and ($Psd1Result))
				{
					Log-Status -Status "Successfully exported all files" -Icon Success
					
					[void] (Import-Module $SelfHostedDLLPath -ErrorAction SilentlyContinue -WarningAction SilentlyContinue)
					[void] (Import-Module $CoreDLLPath -ErrorAction SilentlyContinue -WarningAction SilentlyContinue)
					Start-Sleep -Milliseconds 100
					$ShModuleImportResult = (Get-Module -Name Sorlov.PowerShell.SelfHosted).Name
					$CoreModuleImportResult = (Get-Module -Name Sorlov.PowerShell.Core).Name
					
					IF ((!$ShModuleImportResult) -or (!$CoreModuleImportResult))
					{
						if (!$ShModuleImportResult)
						{
							Log-Status -Status "Error importing: Sorlov.PowerShell.SelfHosted" -Icon Error
						}
						if (!$CoreModuleImportResult)
						{
							Log-Status -Status "Error importing: Sorlov.PowerShell.Core" -Icon Error
						}
					}
					
					IF ($ShModuleImportResult -and $CoreModuleImportResult)
					{
						$NewSelfHostedSplat = @{
							'SourceFile'		 = $PS1
							'DestinationFile'    = $EXE
							'Service'		    = $true
							'ServiceDescription' = ' '
							'ServiceName'	    = $($ServiceName.ToUpper())
							'ServiceDisplayName' = $DisplayName
						}
						
						$null = New-SelfHostedPS @NewSelfHostedSplat
						Start-Sleep -Milliseconds 300
						$null = &$EXE /install | Out-Null
						Start-Sleep -Seconds 3
						
						# Need to stop the service, if it is running, so we can set some more items
						if ((Get-Service -Name $ServiceName).Status -eq "Running")
						{
							$null = Stop-Service -Name $ServiceName -Force
							Start-Sleep -Milliseconds 200
						}
						
						$null = sc.exe description $ServiceName "$Description"
						Start-Sleep -Milliseconds 200
						$DescRes = Get-WmiObject -Class Win32_Service | Where-Object { $_.Name -eq $ServiceName } | Select-Object -ExpandProperty Description
						IF ($DescRes -eq $Description){ Log-Status -Status "Set service description" -Icon Success }
						IF ($DescRes -ne $Description){ Log-Status -Status "Error setting service description" -Icon Error }
						
						$null = sc.exe config $ServiceName start= "$StartupType"
						Start-Sleep -Milliseconds 300
						$sType = Get-WmiObject -Class Win32_Service | Where-Object { $_.Name -eq $ServiceName } | Select-Object -ExpandProperty StartMode
						IF ($sType -eq $StartupType) { Log-Status -Status "Set service startup type" -Icon Success }
						IF ($sType -ne $StartupType) { Log-Status -Status "Error setting service startup type" -Icon Error }					
						
						$null = sc.exe config $ServiceName obj= "$SvcAccountUN" password= "$SvcAccountPW"					
						Start-Sleep -Milliseconds 200
						$startName = Get-WmiObject -Class Win32_Service | Where-Object { $_.Name -eq $ServiceName } | Select-Object -ExpandProperty StartName
						IF ($startName -eq $SvcAccountUN){ Log-Status -Status "Set service account for service" -Icon Success }
						IF ($startName -ne $SvcAccountUN){ Log-Status -Status "Error setting service account for service" -Icon Error }
						
						IF ($StartNow)
						{
							Log-Status -Status "StartNow:TRUE; Starting service" -Icon Warning
							Start-Service -Name $ServiceName
							Log-Status -Status "Service Started" -Icon Success
						}
						
						#return Get-Service -Name $ServiceName | Select-Object *
					}
					
				}
				
				IF ((!$DllShResult) -or (!$DllCoreResult) -or (!$Psd1Result))
				{
					if (!$DllShResult) { $isPathError += "$SelfHostedDLLPath || " }
					if (!$DllCoreResult) { $isPathError += "$CoreDLLPath || " }
					if (!$Psd1Result) { $isPathError += "$PSD1ModulePath || " }
				}
			}
			
			CATCH
			{
				$isPathError = $null
				$isModuleError = $null
				$line = $_.InvocationInfo.Line
				Log-Status -Status "[PROCESS:TRY:CONVERT]error: $($_) AT LINE: $($line) :enderror" -Icon Error
			}
		}
		
		END
		{
			
			IF ($isPathError -ne $null)
			{
				Log-Status -Status "Unable to export or read from: $($isPathError)." -Icon Error
			}
			
			IF ($isModuleError -ne $null)
			{
				Log-Status -Status "Unable to import module(s): $($isModuleError)." -Icon Error
			}
			
		}
	}
	
	FUNCTION Set-FormSize
	{
		PARAM(
			[Parameter(Mandatory = $true)]
			[ValidateSet("Idle","Working")]
			$Size
		)
		
		TRY { 
			switch ($Size) {
				"Idle" {
