				}
				"Working" {
					$MainForm.Size = '399, 592'
					$buttonExpandLogs.Enabled = $true
					$buttonExpandLogs.Visible = $true
				}
			}
		}
		CATCH { $_ }
	}
	
	FUNCTION Log-Status
	{
		PARAM(
			[Parameter(Mandatory = $true)]
			[string]$Status,
			
			[Parameter(Mandatory = $true)]
			[ValidateSet("Success","Error","Warning")]
			$Icon
		)
		
		TRY
		{
			switch($Icon){
				"Success" { $ImageIndex = 0 }
				"Error"   { $ImageIndex = 1 }
				"Warning" { $ImageIndex = 2 }
			}
			
			$listviewStatus.Items.Add("$Status").ImageIndex = $ImageIndex
			$listviewStatus.Items[$listviewStatus.Items.Count - 1].EnsureVisible()
		}
		
		CATCH { $_ }
	}
	
	FUNCTION Check-NoEmptyFields
	{
		TRY
		{
			$ControlsWithTag = @()
			$EmptyControls = @()
			$TextBoxShellObject = [System.Windows.Forms.TextBox]
			$ComboBoxShellObject = [System.Windows.Forms.ComboBox]
			
			foreach ($gControl in $groupboxGeneral.Controls)
			{
				if ($gControl.Tag -eq 'EmptyCheck'){
					$ControlsWithTag += $gControl
				}
			}
			
			foreach ($lControl in $groupboxLogon.Controls)
			{
				if ($lControl.Tag -eq 'EmptyCheck'){
					$ControlsWithTag += $lControl
				}
			}
			
			foreach ($tagControl in $ControlsWithTag)
			{
				if ($tagControl -is $TextBoxShellObject){
					if ( [string]::IsNullOrEmpty( $($tagControl.Text)) ) {
						$EmptyControls += $tagControl
					}
				}
				if ($tagControl -is $ComboBoxShellObject){
					$zeeItem = $tagControl.SelectedItem
					if ( [string]::IsNullOrEmpty($zeeItem)) {
						$EmptyControls += $tagControl
					}
				}
			}
			
			# I have placeholder text in this field, want to make sure we dont pass the placeholder thru
			if ($textboxAccount.Text -eq "domain\username"){
				$EmptyControls += $textboxAccount
			}
			
			if ($EmptyControls) {
				FOREACH ($EmptyCon in $EmptyControls) {
					[string]$nn = $EmptyCon.Name
					Log-Status -Status "Field cannot be empty: $nn" -Icon Error
				}
				Write-Output $false
			}
			
			if (-not $EmptyControls) {
				Write-Output $true
			}
		}
		
		CATCH
		{
			$_
		}
	}
