	$textboxConfirmPassword_TextChanged={
		$pwLength = $textboxPassword.Text.Length
		$thisLength = $textboxConfirmPassword.Text.Length	
		IF ($thisLength -ge $pwLength){
			$pw = $textboxPassword.Text
			$thispw = $textboxConfirmPassword.Text		
			IF ($thispw -ne $pw) { $errorprovider1.SetError($textboxConfirmPassword,"Passwords do not match") }
		}	
		IF ($thisLength -lt $pwLength) { $errorprovider1.Clear() }
	}
	
	$textboxOutputExeName_KeyDown = [System.Windows.Forms.KeyEventHandler]{
		# Do not allow spaces in .exe name	
		IF ($LastKeyWasSpace -eq $true)
		{
			$errorprovider1.Clear()
		}
		IF ($_.KeyCode -eq 'Space')
		{
			$_.Handled = $false
			$_.SuppressKeyPress = $true
			$errorprovider1.SetError($textboxOutputExeName, "No spaces allowed in .exe name")
			$Global:LastKeyWasSpace = $true
		}
		IF ($_.KeyCode -ne 'Space')
		{
			$Global:LastKeyWasSpace = $false
		}
	}
	
	$textboxAccount_Enter={
		IF ( $textboxAccount.Text -eq "domain\username" ){
			$textboxAccount.Text = ''
			$textboxAccount.ForeColor = [System.Drawing.SystemColors]::WindowText
		}
	}
	
	$textboxAccount_Leave={
		IF ( [string]::IsNullOrEmpty($($textboxAccount.Text)) ){
			$textboxAccount.Text = "domain\username"	
			$textboxAccount.ForeColor = 'Gray'
		}
	}
	
