	$buttonInstallService_Click={
		Set-FormSize -Size Working
		Log-Status -Status "Working..." -Icon Success
		Start-Sleep -Milliseconds 650
		$NoEmpties = Check-NoEmptyFields
		
		IF ($NoEmpties){
			
			Log-Status -Status "Verifying service account info" -Icon Warning
			$DomainNamez   = $textboxAccount.Text.Split('\')[0]
			$tehUsername   = $textboxAccount.Text.Split('\')[-1]
			$tehPassyWord  = $textboxConfirmPassword.Text
			
			$CrdzRezlt = Test-Credentials -Context Domain -theUN $tehUsername -thePW $tehPassyWord -DomainName $DomainNamez
			
			IF ($CrdzRezlt -eq $true){ 
			
				Log-Status -Status "Credentials tested successfully..." -Icon Success
				$DestinationFile           = "$($textboxOutputDir.Text)\$($textboxOutputExeName.Text).exe"		
				$ToStartNow                = $null
				SWITCH ($($comboboxStartSvcNow.SelectedItem)){
					'Yes' { $ToStartNow = $true }
					'No'  { $ToStartNow = $false }
				}
				
				[string]$zeeSource         = $textboxSourcePs1File.Text.TrimEnd()
				[string]$zeeEXE            = $DestinationFile 
				[string]$zeeDescription    = $textboxDescription.Text
				[string]$zeeDisplayName    = $textboxDisplayName.Text
				[string]$zeeSvcAccntUN     = $textboxAccount.Text 
				[string]$zeeSvcAccntPW     = $textboxConfirmPassword.Text 
				[string]$zeeStartupType    = $comboboxStartupType.SelectedItem.ToString() 
				[string]$zeeServiceName    = $textboxOutputExeName.Text 
				
				$InstallNewServiceSplat    = @{
				
					'PS1'                  = $zeeSource
					'EXE'                  = $zeeEXE
					'Description'          = $zeeDescription
					'DisplayName'          = $zeeDisplayName
					'svcAccountUN'         = $zeeSvcAccntUN
					'svcAccountPW'         = $zeeSvcAccntPW
					'StartupType'          = $zeeStartupType			
					'ServiceName'          = $zeeServiceName
					'StartNow'             = $ToStartNow
				
				}
				
				Install-PaaS @InstallNewServiceSplat	
	        }
			
			
			IF ($CrdzRezlt -ne $true){
				Log-Status -Status "Service account credentials are invalid" -Icon Error
			} 
			
		}
		
		
	}
